def specialTriplets_raw(nums):
    idxs=list(range(len(nums)))
    ans=[]
    for j in idxs:
        for i in idxs[0:j]:
            if nums[j]*2!=nums[i]:
                continue
            for k in idxs[j+1:]:
                if nums[i]!=nums[k]:
                    continue
                ans.append((i,j,k))
    return len(ans)             
